import React from "react";
import Header from "./Header";
import Footer from "./Footer";

function newNote(){
    <Note title={newNote.title} content={newNote.content}/>
}
function App(){
    return <div><Header />
    notes.map(function (newNote));
   
    <Footer />
    </div>
}
export default App;
